      <div className="Signup">
        <div className="Signup__form">
          <div className="row">
            <div className="col-md-5">
              <h1>Signup</h1>
              <SignupForm />
            </div>
            <div className="col-md-6 ml-auto">
              <div className="image-container">
                <h2 className="">yoyo</h2>
                <img src="" alt="" />
              </div>
            </div>
          </div>
        </div>
      </div>
    );
  }
}

export default Signup;
